import requests

url = "http://127.0.0.1:12000/invoiceRec"

payload="{\r\n    \"imgBase64\": \"data:image/jpeg;base64,\",\r\n    \"removeSeal\": true,\r\n    \"screenshot\": false\r\n}"
headers = {
  'Content-Type': 'application/json; charset;UTF-8'
}

response = requests.request("POST", url, headers=headers, data=payload)

print(response.text)
